import json
import os
from collections import OrderedDict
from itertools import product
from typing import List, Tuple

import fiona
from shapely.geometry import MultiPoint, Polygon, Point, shape

import pyproj
from shapely.ops import transform


def transform_geometry(g1, proj_from, proj_to):
    project = pyproj.Transformer.from_proj(
        pyproj.Proj(init=f'epsg:{proj_from}'),
        pyproj.Proj(init=f'epsg:{proj_to}'))
    g2 = transform(project.transform, g1)
    return g2


class SaveResults:
    def __init__(self, mesa_folder, points_per_section=6, crs=4326,
                 active_line_x=11, active_line_y=11):
        self.active_line_y = active_line_y
        self.active_line_x = active_line_x
        self.crs = crs
        self.points_per_section = points_per_section
        excitation_points_path = os.path.join(mesa_folder, 's')
        reception_points_path = os.path.join(mesa_folder, 'r')
        (self.s_points,
         self.matrix_excitation_points) = self._get_strict_multipoints(
            excitation_points_path)

        self.r_points, _, self.reception_line_distance = self.parse_mesa(
            reception_points_path, y_name='Point numb', x_name='Line name')
        _, self.excitation_line_distance, _ = self.parse_mesa(
            excitation_points_path, y_name='Line name', x_name='Point numb')
        self.matrix_reception_points = self._get_matrix_reception_points()

    def match_coords(self, width, height, min_x, min_y, max_x, max_y):
        ans = [[0 for _ in range(width)] for _ in range(height)]
        for y in range(height):
            for x in range(width):
                ans[y][x] = [
                    min_x + x * (max_x - min_x) / (width - 1),
                    min_y + y * (max_y - min_y) / (height - 1)
                ]
        return ans

    def get_winding_from_polygons(self, polygons: List[Polygon],
                                  folder: str,
                                  postfix: str):
        reception_schema = {
            'geometry': 'MultiPoint',
            'properties': OrderedDict([
                ('day', 'int'),
                ('count', 'int')
            ])
        }
        file = os.path.join(folder, postfix + '.geojson')
        with fiona.open(
                file,
                'w',
                driver='GeoJSON',
                schema=reception_schema,
        ) as fi:
            for i in range(len(polygons)):
                day = i
                if postfix == 'unwinding':
                    day -= 1
                polygon = polygons[i]
                points = self.r_points.intersection(polygon)
                if points.is_empty:
                    continue
                points = transform_geometry(points, self.crs, 4326)
                reception_points = {
                    'geometry': points.__geo_interface__,
                    'properties': OrderedDict([
                        ('day', i + 1),
                        ('count', len(points.geoms))
                    ])
                }
                fi.write(reception_points)
        return file

    def get_polygons_for_winding(self, matrix_reception: list, size: int):
        polygons = [Polygon() for _ in range(size)]
        for y in range(len(matrix_reception)):
            for x in range(len(matrix_reception[0])):
                if not isinstance(matrix_reception[y][x], int):
                    polygon = Polygon([
                        self.matrix_reception_points[y][x],
                        self.matrix_reception_points[y + 1][x],
                        self.matrix_reception_points[y + 1][x + 1],
                        self.matrix_reception_points[y][x + 1],
                    ])
                    polygons[matrix_reception[y][x][1]] = polygons[
                        matrix_reception[y][x][1]].union(polygon)

        return polygons

    def get_winding_reception_points(self,
                                     matrix_reception: list,
                                     size: int, folder: str):
        polygons = self.get_polygons_for_winding(matrix_reception, size)
        file_path = self.get_winding_from_polygons(
            polygons,
            folder,
            'winding',
        )
        return file_path

    def get_unwinding_reception_points(self,
                                       matrix_reception: list,
                                       size: int, folder: str):
        polygons = self.get_polygons_for_winding(matrix_reception, size)
        file_path = self.get_winding_from_polygons(
            polygons,
            folder,
            'unwinding',
        )
        return file_path

    def get_excitation_points(self,
                              min_x: list, min_y: list,
                              max_x: list, max_y: list,
                              folder: str,
                              postfix: str):
        excitation_schema = {
            'geometry': 'MultiPoint',
            'properties': OrderedDict([
                ('day', 'int'),
                ('count', 'int')
            ])
        }
        file = os.path.join(folder, postfix + '.geojson')
        with fiona.open(
                file,
                'w',
                driver='GeoJSON',
                schema=excitation_schema,
        ) as fi:
            for i in range(len(min_x)):
                polygon = Polygon([
                    self.matrix_excitation_points[min_y[i]][min_x[i]],
                    self.matrix_excitation_points[max_y[i]][min_x[i]],
                    self.matrix_excitation_points[max_y[i]][max_x[i]],
                    self.matrix_excitation_points[min_y[i]][max_x[i]],
                ])
                points = self.s_points.intersection(polygon)
                points = transform_geometry(points, self.crs, 4326)
                excitation_points = {
                    'geometry': points.__geo_interface__,
                    'properties': OrderedDict([
                        ('day', i + 1),
                        ('count', len(points.geoms))
                    ])
                }
                fi.write(excitation_points)
        return file

    def parse_mesa(self, geom_file, y_name='Line name', x_name='Point numb'):
        max_point_numb = 0
        min_point_numb = float('inf')
        max_line_name = 0
        min_line_name = float('inf')
        with fiona.open(geom_file) as fiona_rp:
            points = MultiPoint(
                [Point(shape(rp['geometry'])) for rp in fiona_rp])
            for rp in fiona_rp:
                line_name = rp['properties'][y_name]
                point_numb = rp['properties'][x_name]
                if line_name > max_line_name:
                    max_line_name = line_name
                if line_name < min_line_name:
                    min_line_name = line_name
                if point_numb > max_point_numb:
                    max_point_numb = point_numb
                if point_numb < min_point_numb:
                    min_point_numb = point_numb

        line_count = int(max_line_name - min_line_name)
        point_numb_count = int(max_point_numb - min_point_numb)
        if x_name == 'Point numb':
            point_numb_count += 1
        else:
            line_count += 1
        width = (line_count / self.points_per_section)
        height = (point_numb_count / self.points_per_section)
        if x_name == 'Point numb':
            width += 1
        else:
            height += 1
        width = int(width)
        height = int(height)

        min_x_coord = points.bounds[0]
        min_y_coord = points.bounds[3]
        max_x_coord = points.bounds[2]
        max_y_coord = points.bounds[1]
        x_line_distance = (max_x_coord - min_x_coord) / (width - 1)
        y_line_distance = (max_y_coord - min_y_coord) / (height - 1)

        return points, x_line_distance, y_line_distance

    def save_answer(self, answer, folder: str) -> Tuple:
        file_excitation = file_winding = file_unwinding = None
        os.makedirs(folder, exist_ok=True)
        file_excitation = self.get_excitation_points(
            answer.min_x, answer.min_y,
            answer.max_x, answer.max_y,
            folder,
            'excitation',
        )
        file_winding = self.get_winding_reception_points(
            answer.matrix,
            len(answer.min_x), folder
        )
        file_unwinding = self.get_unwinding_reception_points(
            answer.matrix_unwinding,
            len(answer.min_x), folder,
        )
        return file_excitation, file_winding, file_unwinding

    def _get_strict_multipoints(self, geom_file,
                                y_name='Line name',
                                x_name='Point numb'):
        max_point_numb = 0
        min_point_numb = float('inf')
        max_line_name = 0
        min_line_name = float('inf')
        with fiona.open(geom_file) as fiona_rp:
            points = MultiPoint(
                [Point(shape(rp['geometry'])) for rp in fiona_rp])
            for rp in fiona_rp:
                line_name = rp['properties'][y_name]
                point_numb = rp['properties'][x_name]
                if line_name > max_line_name:
                    max_line_name = line_name
                if line_name < min_line_name:
                    min_line_name = line_name
                if point_numb > max_point_numb:
                    max_point_numb = point_numb
                if point_numb < min_point_numb:
                    min_point_numb = point_numb

        line_count = int(max_line_name - min_line_name)
        point_numb_count = int(max_point_numb - min_point_numb)
        point_numb_count += 1
        width = (line_count / self.points_per_section)
        height = (point_numb_count / self.points_per_section)
        width += 1
        width = int(width)
        height = int(height)

        min_x_coord = points.bounds[0]
        min_y_coord = points.bounds[3]
        max_x_coord = points.bounds[2]
        max_y_coord = points.bounds[1]
        self.delta_x = (max_x_coord - min_x_coord) / line_count / 2
        self.delta_y = (max_y_coord - min_y_coord) / point_numb_count / 2
        points = self.match_coords(width, point_numb_count, min_x_coord,
                                   min_y_coord, max_x_coord, max_y_coord)
        matched_matrix = self.match_coords(
            width + 2, height + 2,
            min_x_coord - self.delta_x,
            min_y_coord - self.delta_y,
            max_x_coord + self.delta_x * 12,  # TODO разобраться с коэффициентами
            max_y_coord + self.delta_y * 14
        )
        multi_points = MultiPoint(
            [points[y][x] for y, x
             in product(range(point_numb_count), range(width))]
        )
        self.min_x_coord = min_x_coord
        self.min_y_coord = min_y_coord
        self.max_x_coord = max_x_coord
        self.max_y_coord = max_y_coord
        return multi_points, matched_matrix

    def _get_matrix_reception_points(self):
        min_x_coord = (
                self.min_x_coord -
                self.excitation_line_distance * self.active_line_x
        )
        min_y_coord = (
                self.min_y_coord - self.delta_y * 2 -
                self.reception_line_distance * self.active_line_y
        )
        max_x_coord = (
                self.max_x_coord +
                self.excitation_line_distance * self.active_line_x
        )
        max_y_coord = (
                self.max_y_coord - self.delta_y * 2 +
                self.reception_line_distance * self.active_line_y
        )
        width = (max_x_coord - min_x_coord) / self.excitation_line_distance
        height = (max_y_coord - min_y_coord) / self.reception_line_distance
        width = int(width)
        height = int(height)
        matched_matrix = self.match_coords(
            width + 2, height + 2,
            min_x_coord,
            min_y_coord,
            max_x_coord,
            max_y_coord,
        )
        return matched_matrix

    def convert_coordinates_to_indexes(self, point: Point) -> Tuple:
        for x in range(len(self.matrix_excitation_points[0]) - 1):
            for y in range(len(self.matrix_excitation_points) - 1):
                if (
                        self.matrix_excitation_points[y][x][0]
                        <= point.x <
                        self.matrix_excitation_points[y + 1][x + 1][0]
                ) and (
                        self.matrix_excitation_points[y][x][1]
                        > point.y >=
                        self.matrix_excitation_points[y + 1][x + 1][1]
                ):
                    if x == len(self.matrix_excitation_points[0]) - 2:
                        x -= 1
                    if y == len(self.matrix_excitation_points) - 2:
                        y -= 1
                    return x, y
        raise LookupError(str(point) + ' is not in territory')


